import './App.scss';
import FotoCv from './FotoCV.png';
import {BrowserRouter as Router,Switch,Route,Link,} from "react-router-dom";
import Footer from './Footer'
import Information from './components/Information'
import Resume from './components/Resume'
import Work from './components/Work'
import Skills from './components/Skills'
import Educaction from './components/Education'
import Contact from './components/Contact'
import React, { useState } from 'react';


const Header =(props)=>(<header><h1>{props.title}</h1></header>);

const Nav =()=>{

const [state, setState] = React.useState({
    checkedA: true,
    checkedB: true,
  });

  const handleChange = (event) => {
    setState({ ...state, [event.target.name]: event.target.checked });
  };

return(
<Router>

<div id='bar-nav'>

    <div>
      <Switch
        checked={state.checkedA}
        onChange={handleChange}
        name="checkedA"
        inputProps={{ 'aria-label': 'secondary checkbox' }}
      />
      <Switch
        checked={state.checkedB}
        onChange={handleChange}
        color="primary"
        name="checkedB"
        inputProps={{ 'aria-label': 'primary checkbox' }}
      />
</div>

</div>
<div id='contain'>
<nav>
<div id='first'>
<div id="Foto">
<img src={FotoCv} alt="Foto CV"/>
</div>
<h1>Ezequiel Yacar</h1>
</div>
<div id='nav'>
<ul>
<Link to={'/Information'}><li>Informaci贸n Personal</li></Link>
<Link to={'/Resume'}><li>Resumen Ejecutivo </li></Link>
<Link to={'/Education'}><li>Educaci贸n</li></Link>
<Link to={'/Job'}><li>Experiencia Laboral</li></Link>
<Link to={'/Skills'}><li>Aptitudes</li></Link>
<Link to={'/Contact'}><li>Contacto</li></Link>
</ul>
</div>
</nav>
</div>
<Switch>    
<Route exact path='/'></Route>  
<Route path='/Information'>
<Header title='Informaci贸n Personal'/>
<Information name='Nombre completo' Bday='Fecha de Nacimiento' Bplace='Lugar de Nacimiento' status='Estado Civil' Id='DNI'/>
</Route>
<Route path='/Resume'><Header title='Resumen Ejecutivo'/><Resume/></Route>
<Route path='/Education'><Header title='Educaci贸n'/><Educaction/></Route>
<Route path='/Job'><Header title='Experiencia Laboral'/><Work/></Route>
<Route path='/Skills'><Header title='Aptitudes'/><Skills/></Route>
<Route path='/Contact'><Header title='Contactate conmigo'/><Contact/></Route>   
</Switch>
<Footer/>
</Router>
)};

export default Nav;
